tests.code:
cy.api({
  method: "GET",
  url: `${url}?cnpj_cliente=&token=${token}`,
  failOnStatusCode: false
}).then(r => {
  expect(r.status).to.eq(401);
});

cy.api({
  method: "GET",
  url: `${url}?cnpj_cliente=${cnpjCliente}&token=`,
  failOnStatusCode: false
}).then(r => {
  expect(r.status).to.eq(401);
});

cy.api({
  method: "GET",
  url: `${url}?cnpj_cliente=${cnpjCliente}&token=${token}&sm=31692655&pedido=123456`,
  failOnStatusCode: false
}).then(r => {
  expect(r.status).to.eq(200);
  expect(r.body.dados).to.be.an("array").and.to.be.empty;
});
